export default class Section4 extends Component {
    render() {
        return(
            <section>
                <div id="titleSection4">MOTION GRAPHICS STUDIO SHOW</div>
                <div id="picSection4"></div>
                <div id="watch">Watch Videos</div>
            </section>
        );
    }
}
